import { useRef } from 'react'
import './statics/css/Menu.css'

var Menu = props=>{
    var ref = useRef({})

    var login = props.login

    var open = props.open



    return(
        <div className="menu_box" id = "menu_box" ref= {el => ref.current['menu_box']}>
            <div className="menu_container" id = "menu_container" ref = { el => ref.current['menu_container']}>
                

            </div>
        </div>
    )
}


export default Menu;
